  <div id="gameDiv" class="gameDiv" style="display: block;">
    <table class="logoTable">
      <td colspan="21">
        <img id="logoImg" src="" width="100%" draggable="false"/>
      </td>
    </table>
    <table class="settingsTable">
      <tr>
        <td colspan="3" id="diffNum" class="timer" >10</td>
        <td colspan="4" class="title">الأسرع</td>

          <select id="finishSelect" class="mySelect" onchange="changeFinish()">
            <option >نعم</option>
            <option selected="selected">لا</option>
          </select>
        </td>
        <td colspan="3" class="title">الوقت</td>
        <td  colspan="4">
          <select id="timerValueSelect" class="mySelect" onchange="changeTimerValue()">
            <option >15 ثانية</option>
            <option>30 ثانية</option>
            <option>45 ثانية</option>
            <option selected="selected">دقيقة</option>
            <option >دقيقة ونصف</option>
            <option >دقيقتان</option>
            <option >دقيقتان ونصف</option>
            <option >3 دقائق</option>
            <option >4 دقائق</option>
            <option >5 دقائق</option>
          </select>
        </td>
        <td colspan="4" id="timer" class="timer">1:00</td> 
      </tr>
      <tr>
        <td colspan="5" class="title">نوع الصور</td>
        <td  colspan="7">
          <select id="typeSelect" class="mySelect" onchange="changeType()">
          </select>
        </td>
        <td colspan="6" class="title">عدد الأخطاء</td>
        <td  colspan="3">
          <select id="wrongSelect" class="mySelect" onchange="changeWrong()">
            <option >1</option>
            <option >2</option>
            <option >3</option>
            <option >4</option>
            <option selected="selected">5</option>
            <option >6</option>
            <option >7</option>
            <option >8</option>
            <option >9</option>
            <option >10</option>
          </select>
        </td>
      </tr>
      <tr>
        <td colspan="5" id="newImageBtn" class="newImageBtn" onclick="startGame()">صورة جديدة</td>
        <td colspan="5" id="startBtn" class="startBtn" onclick="sendNewGame()">بدء اللعبة</td>
        <td colspan="5" id="sendAnswersBtn" class="sendAnswersBtn" onclick="showAnswers()">إظهار الأجوبة</td>
        <td colspan="6" id="sendScoreBtn" class="sendScoreBtn" onclick="showMyScore()">إظهار السكور</td>
      </tr>
    </table>
    <table id="gameTable" class="gameTable">
      <tr>
        <td style="position: relative;">
          <div id="circleDiv" class="circleDiv"></div>
          <img src="" id="puzzImage" onclick="wrongClick()" width="90%" draggable="false"/>
        </td>
      </tr>
    </table>
    <table class="scoreTable" id="scoreTable"></table>
    <table class="watchTable">
      <tr>
        <td colspan="12">
          <p id="watchLink"  style="text-align:center;color: white;font:3vmin Arial;"></p>
        </td>
      </tr>
    </table>
